oxy_webhelp_navlinks = {"jira_recovery-d22908e30502":{"topics":[{"title":"Atlassian Jira data relationships and cascading impact","shortdesc":"<p class=\"shortdesc\">Atlassian Jira data types are based on data type relationships. <span class=\"ph\">RSC<\/span>         allows you to maintain these relationships when restoring information.<\/p>","href":"jira\/jira_relationships.html","attributes":{"data-id":"jira_relationships"},"menu":{"hasChildren":false},"tocID":"jira_relationships-d22908e30513","topics":[]},{"title":"Restoring Altassian Jira issues","shortdesc":"<p class=\"shortdesc\">Restore issue types, such as epics, stories, bugs, tasks, and subtasks, to their         original location from any point-in-time snapshot if data is lost or         compromised.<\/p>","href":"jira\/jira_restoring_issue.html","attributes":{"data-id":"jira_restoring_issue"},"menu":{"hasChildren":false},"tocID":"jira_restoring_issue-d22908e30527","topics":[]},{"title":"Restore Atlassian Jira issue keys","shortdesc":"<p class=\"shortdesc\">When the Atlassian Jira issue you are restoring has been deleted in your Atlassian         Jira site, Jira creates a new issue key that identifies your work in Jira. <span class=\"ph\">RSC<\/span> provides a mapping of the new key value to the old key value for your         reference.<\/p>","href":"jira\/jira_restore_issue_keys.html","attributes":{"data-id":"jira_restore_issue_keys"},"menu":{"hasChildren":false},"tocID":"jira_restore_issue_keys-d22908e30538","topics":[]},{"title":"Restoring Altassian Jira settings","shortdesc":"<p class=\"shortdesc\">Restore Atlassian Jira settings, including workflows, filters, dashboards, and         screens, to their original location. Use any point-in-time snapshot to restore data if your         data is lost.<\/p>","href":"jira\/jira_restoring_settings.html","attributes":{"data-id":"jira_restoring_settings"},"menu":{"hasChildren":false},"tocID":"jira_restoring_settings-d22908e30552","topics":[]}]}};